const ADD = "addCart/ADD";

export const add = (payload) => ({
    type: ADD,
    payload
});

const initialState = [{ id: "", price: "" }];

export default function addCart(state = initialState, action) {
    switch (action.type) {
        case ADD:
            console.log(action);
            let temp = [...state];
            temp.push(action.payload);
            return temp;
        default:
            return state;
    }
}
